import React, { useState } from "react";
import "./HomePage.css";

function HomePage({ onLogout }) {
  const [activeTab, setActiveTab] = useState("Servers");

  const renderContent = () => {
    switch (activeTab) {
      case "Servers":
        return <p>Server management tools and list go here.</p>;
      case "Zones":
        return <p>Zone management section.</p>;
      case "Server Statistics":
        return <p>Performance graphs and metrics appear here.</p>;
      default:
        return null;
    }
  };

  return (
    <div className="container">
      <header className="homepage-header">
        <div className="homepage-left">
          <span role="img" aria-label="home" className="home-icon">üè†</span>
          <a href="/" className="home-link">Home</a>
        </div>
        <button className="button logout-button" onClick={onLogout}>
          Logout
        </button>
      </header>

      <div className="card homepage-card">
        <nav className="tabs">
          {["Servers", "Zones", "Server Statistics"].map((tab) => (
            <button
              key={tab}
              className={`tab-button ${activeTab === tab ? "active" : ""}`}
              onClick={() => setActiveTab(tab)}
            >
              {tab}
            </button>
          ))}
        </nav>

        <main className="tab-content">{renderContent()}</main>
      </div>
    </div>
  );
}

export default HomePage;
